Международная азиатская сеть (Asian Highway — AH) — проект странАзии и Экономической и социальной комиссии ООН по странам Азиатско-Тихоокеанского региона, который предусматривает улучшение автомагистральной сети в странах Азии. Общая длина всех маршрутов 141 236 км (2006 год), из них: 
* 14,4 % — автомагистрали; 
* 13,5 % — I класс; 
* 37,0 % — II класс; 
* 25,8 % — III класс; 
* 8,7 % — IV и V классы; 
* 0,7 % — иные. Первым маршрутом стал AH1, который связал Токио с границей Турции и Болгарии. Он прошёл через Южную и Северную Кореи, Китай и другие страны юго-восточной, центральной и южной Азии. Предполагается, что коридор улучшит торговые связи между восточно-азиатскими странами, Индией и Россией. Для завершения строительства магистрали требуется потратить в 2007 году 25 миллиардов долларов США, ещё 18 миллиардов долларов потребуется на реконструкцию 26 тысяч километров магистрали.

Міжнародна азійська мережа (Asian Highway — AH) — проєкт країн Азії та Економічної і соціальної комісії ООН по країнах Азійсько-Тихоокеанського регіону, який передбачає покращення автомагістральної мережі в країнах Азії. Загальна довжина всіх маршрутів 141 236 км (2006 рік), з них: 
* 14,4 % — автомагістралі; 
* 13,5 % — I клас; 
* 37,0 % — II клас; 
* 25,8 % — III клас; 
* 8,7 % — до IV і V класи; 
* 0,7 % — інші. Першим маршрутом став , який пов'язав Токіо з кордоном Туреччини і Болгарії. Він пройшов через Південну і Північну Кореї, Китай і інші країни південно-східної, центральної та південної Азії. Передбачається, що коридор поліпшить торговельні зв'язки між східно-азійськими країнами, Індією і Росією. Для завершення будівництва магістралі потрібно витратити в 2007 році 25 мільярдів доларів США, ще 18 мільярдів доларів буде потрібно на реконструкцію 26 тисяч кілометрів магістралі.
